import "../../components/NavBar/NavBar.css";

export default function Footer() {
  return (
    <div className="nav">
      <div className="nav-items">
        <p>Home</p>
        <p>Shop</p>
        <p>My Favorites</p>
      </div>
    </div>
  );
}
